//速度较快的一种方法 
int lengthOfLongestSubstring(string s) {
        set<char> test;
         
        int maxlen = 0;
        int curlen = 0;
        int i;
     
        int strHead = 0;
     	
     	for(i = 0; i < s.length(); ++i)
     	{
     		auto res = test.insert(s[i]);
     		
     		if(res.second == false)
            {
            	curlen = test.size();
            	 
                maxlen = maxlen > curlen ? maxlen : curlen;
            	int j;
            	int tmp = strHead;
            	for(j = i-1; j >= strHead;j--)
            	{
            		if(s[j] == s[i])
            		{
            			strHead = j+1;
					}
				}
				
                curlen = i - strHead + 1;
                maxlen = maxlen > curlen ? maxlen : curlen;
                for(j = strHead-1; j >= tmp; j-- )
                {
                	test.erase(s[j]);
				}
				test.insert(s[i]);
            }
		 }
        
       curlen = test.size();
       maxlen = maxlen > curlen ? maxlen : curlen;
        return maxlen;
    }
